export * from "./listsAction";
export * from "./cardsAction";
export * from "./editAction";

export const CONSTANTS = {
    ADD_CARD: "ADD_CARD",
    ADD_LIST: "ADD_LIST",
    EDIT_CARD: "EDIT_CARD",
    DELETE_CARD: "DELETE_CARD"
};

export const deleteCard = ({listID, cardID}) => {
    return {
        type: CONSTANTS.DELETE_CARD,
        payload: {listID, cardID}
    };
}
